import React, { Component } from "react";
import { Spinner } from "react-bootstrap";
const Spin = (props) => {
  return (
    <React.Fragment>
      <Spinner style={{ position: "fixed" }} animation="border" role="status">
        <span className="sr-only">Loading...</span>
      </Spinner>
    </React.Fragment>
  );
};

export default Spin;
